	var id = location.pathname.split( "/detalle/" )[1];
	
	

	return (
		<section className="detalleLibro">
			<h2>DETALLE LIBRO</h2>
			<h2>id: <sub>{ id }</sub></h2>
		</section>
	);
}

export default LibroDetalle;
